using ExternalService.Model.Requests;
using Microsoft.Extensions.Options;
using Shared.Models;
using System;
using System.Threading.Tasks;
using ImageObject = System.Object;

namespace ExternalService.src
{
    public class ExternalRecognitionService : IExternalRecognitionService
    {
        private readonly IOptions<ExternalServiceInfo> _externalServiceInfo;

        /// <summary>
        /// Временное константное изображение
        /// </summary>
        private const string _image =
            "" +
            "" +
            "" +
            "" +
            "" +
            "" +
            "" +
            "" +
            "" +
            "" +
            "" +
            "";


        public ExternalRecognitionService(IOptions<ExternalServiceInfo> externalServiceURL)
        {
            _externalServiceInfo = externalServiceURL;
        }

        public async Task<ExternalObjectModel> GetRecognition(string image)
        {
            var response = await RequestSender.Send(_externalServiceInfo.Value.URL, new RegulaServiceRequest(image));
            var externalModel = response.ConverToCommonType();
            externalModel.Image = SetImage(image);
            return externalModel;
       
        }
        public byte[] SetImage(string image)
        {
            return Convert.FromBase64String(image);
        }
    }
}
